import React, { useState } from 'react';
import styled from 'styled-components'

const ButtonElement = styled.button`
    font-size: 20px;
    font-weight: 500
    letter-spacing: .25px;
    background-color: #eb3323;
    width: 300px;
    height: 20px;
    border-radius: 4px;



`;

const Button = (props) => (
    <ButtonElement  {...props} >{props.name}</ButtonElement>
);

export { Button };
